アクアフレッシュ クリアミント 35g<br>ブランド：アクアフレッシュ<br>販売・製造元：アース製薬<br><br>フッ素配合の歯磨きです。<br>フッ素がエナメル質表層のより深くまで浸透して永久歯の虫歯を予防。<br>必須ミネラルの補充を助け、歯垢から出る酸による侵食を防ぎます。<br>クリアミントの香り。<br>医薬部外品。<br> <br>ご注意<br>傷などに直接つけないようにしてください。<br>発疹などの異常が現れた場合は使用を中止し、医師に相談してください。<br> <br>成分<br>●基剤：精製水●湿潤剤：ソルビット液、濃グリセリン、PEG-8●清掃剤：含水ケイ酸●粘結剤：含水ケイ酸、キサンタンガム、カラギーナン●発泡剤：ラウリル硫酸Na●香味剤：香料(クリアミント)、サッカリンナトリウム●着色剤：酸化チタン、赤226、青色1●薬用成分：フッ化ナトリウム(フッ素)、塩化セチルピリジニウム(CPC) <br><br>お問い合わせ先<br>アース製薬株式会社お客様窓口：0120-461-851 <br>日用品／オーラルケア／歯磨き(ハミガキ)／フッ素配合歯磨き<br>JANコード： 4901080753212<br><br>CS：100<br>区分：医薬部外品<br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
