モンダミン ナイトクリア 1000ml<br>ブランド：モンダミン<br>販売・製造元：アース製薬<br><br>口臭・ネバツキを防ぐ薬用マウスウォッシュです。<br>長時間殺菌処方で、殺菌成分CPCが効果的にお口に留まるから、おやすみ前にクチュクチュするだけで、爽やかなお口が朝まで続きます。<br>プレミアムハーブの香味。<br>医薬部外品。<br> <br><br><br>使用方法<br>●日常(毎日)の歯磨きに加え、約20mLをお口に含んで、20-30秒程すすいでから吐き出してください。<br>●使用後、お口をすすぐ必要はありません。<br>●いつでも使用できますが、歯磨き後やおやすみ前の使用をおすすめします。<br>●キャップが計量カップになっています。<br> <br><br>使用上の注意<br>●内服液ではありませんので、飲まないで下さい。<br>●直射日光を避け、子供の手の届かない所に保管してください。<br>●口中の異常、発疹、かゆみ等の症状が現れた場合は使用を中止し、医師に相談してください。<br> 有効成分セチルピリジニウム塩化物水和物(CPC)、グリチルリチン酸ジカリウム(GK2)その他の成分●湿潤剤：濃グリセリン●溶剤：エタノール●矯味剤：キシリット●pH調整剤：リン酸2水素Na、リン酸1水素Na●香料(プレミアムハーブタイプ)※アルコールを配合しています。<br> 効能・効果口臭の防止。<br>歯垢の付着を防ぐ。<br>歯肉炎の予防。<br>口内を浄化する。<br>口中を爽快にする。<br> <br><br>お問い合わせ先<br>アース製薬株式会社 お客様窓口TEL：0120-81-6456受付時間：9：00-17：00(土・日・祝日を除く) <br>日用品／オーラルケア／口臭対策／薬用マウスウォッシュ<br>JANコード： 4901080528919<br><br>CS：9<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
