モンダミン アクア ソフトシトラス 1080ml<br>ブランド：モンダミン<br>販売・製造元：アース製薬<br><br>余分な甘味を省き、ミント感やアルコールの刺激を減らした後味の残りにくいマウスウォッシュです。<br>ソフトシトラスの香味。<br>よごれ洗浄補助成分TPP配合。<br>お口のトラブルの原因となるミクロの汚れ・ネバネバをしっかり洗浄します。<br>毎日使う方にお得なビッグサイズ1080ml入り。<br>さっぱりやさしい、ノンアルコールタイプ。<br> <br><br><br>使用方法<br>●適量(10-20mL)をお口に含んで、約20-30秒ほどすすいでからはきだしてください。<br>●キャップが計量カップになっています。<br>●使用後、お口を水ですすぐ必要はありません。<br> <br><br>使用上の注意<br>●内服液ではありませんので、飲まないでください。<br>●子供の手の届かないところに保管してください。<br>●口中の異常、発疹、かゆみ等の症状が現れた場合は使用を中止し、医師に相談してください。<br> <br>成分<br>●溶剤：水●湿潤剤：グリセリン●溶剤：PG●矯味剤：キシリトール●洗浄剤：セテス-25●可溶化剤：PEG-60水添ヒマシ油●保存剤：メチルパラベン、フェノキシエタノール●香味剤：香料(ソフトシトラスタイプ)●洗浄補助剤：三リン酸5Na(TPP)●pH調整剤：リン酸Na●洗浄剤：EDTA-2Na●pH調整剤：リン酸2Na <br><br>お問い合わせ先<br>アース製薬株式会社お客様窓口：0120-81-6456受付時間：9：00-17：00(土、日、祝日を除く) <br>日用品／オーラルケア／口臭対策／マウスウォッシュ<br>JANコード： 4901080502315<br><br>CS：9<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
