薬用モンダミン メディカルケア 600ml<br>ブランド：モンダミン<br>販売・製造元：アース製薬<br><br>歯肉炎の原因・症状を3つの薬用成分がブロックする液体歯磨きです。<br>殺菌成分CPC(セチルピリジニウム塩化物水和物)を配合。<br>口腔内の原因菌を殺菌します。<br>抗炎症成分GK2(グリチルリチン酸ジカリウム)を配合。<br>歯ぐきのハレと炎症を防ぎます。<br>出血予防成分TXA(トラネキサム酸)を配合。<br>歯ぐきからの出血を防ぎます医薬部外品。<br> <br><br><br>使用方法<br>日常(毎日)の歯磨きに加え、約20mLをお口に含んで、20-30秒程すすいでから吐き出してください。<br>使用後、お口を水ですすぐ必要はありません。<br>いつでも使用できますが、歯磨き後やおやすみ前の使用をおすすめします。<br>キャップが計量カップになっています。<br> <br><br>使用上の注意<br>●内服液ではありませんので、飲まないでください。<br>●直射日光を避け、子供の手の届かないところに保管してください。<br>●口中の異常、発疹、かゆみ等の症状が現れた場合は使用を中止し、医師に相談してください。<br>※アルコールを配合しています。<br> <br>成分<br>有効成分：セチルピリジニウム塩化物水和物(CPC)、グリチルリチン酸ジカリウム(GK2)、トラネキサム酸(TXA)その他の成分：湿潤剤-濃グリセリン、溶剤-エタノール、可溶剤-ポリオキシエチレン硬化ヒマシ油、矯味剤-キシリット、pH調整剤-リン酸二水素ナトリウム、リン酸一ナトリウム、香料-(メディカルハーブタイプ)、保存剤-パラベン 効能・効果歯肉炎の予防。<br>出血を防ぐ。<br>歯垢の付着を防ぐ。<br>口臭の防止。<br>口中を浄化する。<br>口中を爽快にする。<br> <br><br>お問い合わせ先<br>アース製薬株式会社お客様窓口：TEL0120-81-6456受付時間9：00-17：00(土・日・祝日を除く) <br>日用品／オーラルケア／歯磨き(ハミガキ)／液体歯磨き<br>JANコード： 4901080526519<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
