新ポリグリップ 無添加 20g<br>ブランド：ポリグリップ<br>販売・製造元：アース製薬<br><br>噛んでもずれにくいクリームタイプの入れ歯安定剤です。<br>無添加で、色素・香料を含みませんので、味をほとんど変えずに食事を楽しめます。<br>管理医療機器。<br>※亜鉛は含まれておりません。<br> <br>禁止●次の方は使用しないで下さい。<br>1.本品による過敏症状(発疹・発赤、かゆみ、はれ等)を起こしたことがある方。<br>2.入れ歯が直接触れるところに荒れ、痛み、傷、はれなどの症状のある方。<br>3.食べ物などの飲み込みが困難な方。<br>(喉に詰まる、気管に入る恐れがある。<br>) <br><br>使用方法<br>1.入れ歯をよく洗い、水分を完全に取ります。<br>2.入れ歯に数ヵ所、新ポリグリップ無添加を絞り出します。<br>最初は少なめの量でお試しになり、適量を決めて下さい。<br>ぬりすぎやあまり端の方につけないように注意して下さい。<br>使用は1日1回、総量は3.0cm以内にして下さい。<br>3.入れ歯を口にはめ込む前に、口内を水ですすいで下さい。<br>4.入れ歯を口にはめ込み、1分間ほど軽く押さえて下さい。<br>新ポリグリップ無添加は、だ液などにより徐々に溶けながら粘着力を発揮し、入れ歯を安定させます。<br>※プラスチック床、金属床の入れ歯にもご使用いただけます。<br>(特殊な素材の入れ歯には使用できない場合があります。<br>)※本品はブリッジ、差し歯、一部の部分入れ歯には使用できません。<br> <br><br>使用方法<br>に関する注意●本品をつけた入れ歯は必ず就寝時にはずしてください。<br>(本品が溶け出し、喉を塞ぐことがあります。<br>)●本品をつけたまま入れ歯を乾燥させないで下さい。<br>(本品が固まって取りにくくなることがあります。<br>)●1回の塗布で翌日までの連続使用はしないで下さい。<br>(菌の繁殖など、口腔衛生上良くないことがあります。<br>) <br><br>使用上の注意<br>●長期連用しないで下さい。<br>連用する場合には歯科医師に相談して下さい。<br>(歯ぐきがやせる、噛みあわせが悪くなることがあります。<br>)●次の場合は、直ちに使用を中止し、医師、歯科医師又は薬剤師に相談して下さい。<br>1.本品の使用中又は使用後に発疹・発赤、かゆみ、はれ等の症状が現れた場合。<br>2.継続的な下痢や便秘の症状又は増強が見られた場合。<br>●歯ぐきがやせる等により不適合になった入れ歯を本品で安定させるのは一時的な場合とし、できるだけ早く歯科医師に入れ歯の調整を相談して下さい。<br> <br>成分<br>ナトリウム/カルシウム・メトキシエチレン無水マレイン酸共重合体塩、カルポキシメチルセルロース、軽質流動パラフィン、白色ワセリン<br> 原産国アイルランド 保管および取扱い上の注意1.小児や第三者の監督が必要な方の見えないところ及び手の届かないところに保管して下さい。<br>2.直射日光の当たらない涼しく乾燥した場所に、キャップをしっかりとしめて保管して下さい。<br>(本品の成分が分離することがあります。<br>)3.冷蔵庫等の低温下で保管すると本品が固くなり絞り出しにくくなります。<br>絞り出しにくくなった場合は、18度-28度まで温めることで改善します。<br>4.入れ歯の表面に水分が残ったままの状態で塗布するなどし、チューブのしぼり出し口を濡れたまま放置すると、内容物が固まって出せなくなる場合があります。<br> <br><br>お問い合わせ先<br>グラクソ・スミスクライン株式会社03-5786-5013 <br>日用品／オーラルケア／入れ歯／入れ歯安定剤<br>JANコード： 4901080719119<br><br>CS：96<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
